    false,nt"url": null,nt"notes": "This project is a cooperative effort among
    the National Ocean Service, National Centers for Coastal Ocean Science, Center for
    Coastal Monitoring and Assessment; the University of Hawaii; and Analytical Laboratories
    of Hawaii, LLC. IKONOS imagery was purchased to support the Pacific Islands Geographic
    Information System (GIS) project and the National Ocean Service's (NOS) coral mapping
    activities. One-meter panchromatic and four-meter multi-spectral data were purchased
    for each study area. The enhanced spectral resolution of multispectral imagery and
    control of bandwidths of multispectral data yield an advantage over color aerial
    photography particularly when coral health and time series analysis of coral reef
    community structure are of interest. The IKONOS imagery was processed to minimize
    atmospheric and water column effects. Photointerpreters can accurately and reliably
    delineate boundaries of features in the imagery as they appear on the computer monitor
    using a software interface such as the Habitat Digitizer.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
